import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import classes from './coment.module.css';
import { Container, Row, Col, Nav, Button, Navbar, Form, FormControl} from 'react-bootstrap';
import Dialogs from '../dialogs/dialogs';
const Coment = () => {
    return (
<>
    <Container>
        let DialogsData =[
            (id: 1, name::=Artem)
        ]
            <Dialogs id="1" name="Artem"/>
            <Dialogs id="2" name="Artem2"/>
            <Dialogs id="3" name="Artem3"/>
            <Dialogs id="4" name="Artem4"/>
            <Dialogs id="5" name="Artem5"/>
    </Container>
</>
    );
}
export default Coment;
